import "./App.css";
import { BrowserRouter, Router, Route } from "react-router-dom";


function App() {
  return (
    <BrowserRouter>
    <Router>
      <Route path="/" component={Home} exact />
      <Route path="/property/:id" component={Property} />
      <Route path="/about" component={About} />
    </Router>
    </BrowserRouter>
  );
}

export default App;
